import styled from 'styled-components'
import fetch from 'isomorphic-unfetch'
import Link from 'next/link'
import { BrowserView, MobileView } from 'react-device-detect'

const MainContainer = styled.div`
  display: flex;
  align-items: center;
  align-self: center;
  width: 100%;
  background-color: pink;
`

const TableContainer = styled.div`
  display: grid;
  grid-template: auto / 1fr;
`

const TableRow = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  padding: 1.5rem;

  &:nth-child(even){
    background-color: rgba(0,0,0,.1);
  }
`

const CellHeader = styled.span`
  font-size: 1.4rem;
  font-weight: bold;
`

const CellData = styled.span`
  font-size: 1.4rem;
  justify-self: end;
`



const Table = () => (
  <MainContainer>
    <TableContainer>
      <TableRow>
        <CellHeader>Suction</CellHeader>
        <CellData>94</CellData>
      </TableRow>
      <TableRow>
        <CellHeader>Stage 1 Disharge</CellHeader>
        <CellData>293</CellData>
      </TableRow>
      <TableRow>
        <CellHeader>Stage 1 Discharge</CellHeader>
        <CellData>691</CellData>
      </TableRow>
    </TableContainer>
  </MainContainer>
)


export default Table
